import React from "react";
import '../Hojas de Estilos/Nosotros.css';
function Nosotros(){
    return(
        <section id="sobre-nosotros" className="seccion-nosotros">
            <h1 className="seccion-nosotros-titulo" >Sobre nosotros</h1>
            <p className="seccion-nosotros-texto">
            Fundado hace más de dos años por dos amigas que compartían la misma pasión por la educación inclusiva, nuestro consultorio de educación especial en La Punta, San Luis, Argentina, ha crecido y florecido desde su inicio. Una de nuestras fundadoras es una apasionada profesora de educación especial, mientras que la otra es una dedicada acompañante terapéutica. Juntas, han establecido un espacio donde más de diez profesionales, entre profesores y acompañantes, trabajan arduamente para brindar apoyo y orientación a nuestros queridos alumnos. Estamos comprometidos con proporcionar un entorno educativo y terapéutico que nutra el crecimiento y el bienestar de cada niño, construyendo un puente hacia un futuro lleno de logros y aprendizajes significativos.
            </p>
        </section>
    );
}

export default Nosotros;
